# ------------------- Check and install Python and libs -------------------

def is_python_installed():
    try:
        subprocess.check_output(["python", "--version"])
        return True
    except Exception:
        return False

def is_pip_installed():
    try:
        subprocess.check_output([sys.executable, "-m", "pip", "--version"])
        return True
    except Exception:
        return False

def install_python():
    print("Python is not installed. Download it from: https://www.python.org/downloads/")
    print("After installation, restart the program.")
    sys.exit()

def install_libraries():
    required_libraries = ["requests", "colorama", "keyboard", "pygame"]
    for lib in required_libraries:
        try:
            subprocess.check_call([sys.executable, "-m", "pip", "show", lib], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
        except subprocess.CalledProcessError:
            print(f"Installing: {lib}...")
            subprocess.check_call([sys.executable, "-m", "pip", "install", lib])
            print(f"{lib} installed successfully.")

if not is_python_installed():
    install_python()

if not is_pip_installed():
    print("Pip is not installed. Download it from: https://pip.pypa.io/en/stable/installation/")
    sys.exit()

install_libraries()

